def transform(sequence):
    sequence = list(sequence)
    first_non_zero_index = 0
    last_zero_index = 0
    for i in range(len(sequence)):
        if sequence[i] != '0':
            first_non_zero_index = i
            break
    for i in range(first_non_zero_index, len(sequence)):
        if sequence[i] == '0':
            last_zero_index = i
    sequence.insert(last_zero_index, sequence.pop(first_non_zero_index))
    return "".join(sequence)
